Today we have some common errors on these exercises followed by corrected versions to get the absolute most out of your time in the gym. Let us know what you think!üòé

TRX ROW
üîπEstablish the angle appropriate for you, the closer you get to the anchor the harder the row
üîπLower the body away from the straps
üîπPull the handles toward the upper abs
üîπElbows a fist width distance from the body
üîπElbow stays at 90 degrees 

TRX FACEPULL
üîπElbows and shoulders both at 90 degrees
üîπPull fists toward sides of your head 
üîπControl lowering of the body

üö® For any TRX Exercise its important to keep the straps taut and to maintain an active core üö® 

SEATED BANDED ROW
üîπChest tall throughout row
üîπPull bands toward upper abs
üîπElbows at 90 degrees
üîπElbows fist width away from the body
üîπKeep band taut

CHEST SUPPORTED ROW
üîπKeep chest tall off the bench
üîπSqueeze mid back and bring dumbbells to hip
üîπElbows fist width apart from body

BENT OVER BARBELL ROW
üîπMaintain hip hinge through exercise
üîπBrace the core
üîπPull bar towards upper abs
